        this.setState({count:this.state.count+1})      
    }
    decrement(){
    this.setState({count:this.state.count-1})
    }
    reset(){
    this.setState({count:0})
    console.log("reset")
    }
    render()
    {
        return(
            <>
             <p>{this.state.count}</p>
             <br></br>
            <button onClick={()=>this.increment()} >ADDITION</button>
